// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract FeeManager {
    address public owner;

    uint256 public fee1;
    uint256 public fee2;
    uint256 public fee3;
    uint256 public fee4;

    event FeesUpdated(uint256 fee1, uint256 fee2, uint256 fee3, uint256 fee4);

    modifier onlyOwner() {
        require(msg.sender == owner, "Ownable: caller is not the owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function setFees(uint256 _fee1, uint256 _fee2, uint256 _fee3, uint256 _fee4) external onlyOwner {
        fee1 = _fee1;
        fee2 = _fee2;
        fee3 = _fee3;
        fee4 = _fee4;

        emit FeesUpdated(fee1, fee2, fee3, fee4);
    }
}
